import React from 'react';
import axios from 'axios';

const User = ({users}) => (
  <div>
    <ul>
      { users.map( user => (
        <ul>
          <li key={user}>user</li>
        </ul>
      ))}
    </ul>
  </div>
);

User.getInitialProps = async () => {
  const response = await axios.get('https://swapi.co/api/people/')

  return { users: response}
};

export default User;
